import AddDoctor from "./AddDoctor"
import { connect } from 'react-redux';
const mapStateToProps = (store) => {
    return {
        doctorData: store.reducer2

    }
}
const mapDispatchToProps = (dispatch) => {
    return {
        addDoctor: (drNo, drName, drQuali,drSpeciali) => dispatch(
            { type: "ADD_DOCTOR",  doctorNumber: drNo, name: drName, qualification: drQuali, speciality: drSpeciali }
        ),
    }
}
export default connect(mapStateToProps, mapDispatchToProps)(AddDoctor);
